import React from 'react'

function Header() {
    return (
       <header style={headerStyle}>
           <h1>TodoList</h1>
       </header>
    )
}

const headerStyle ={
    background: "green",
    color: "blue",
    textAlign: "center",
    padding: "10px"
}

export default Header;
